import { Fragment } from "react";

import QuoteList from "../components/quotes/QuoteList";

const Dummy_Quotes = [
  { id: "q1", author: "Himanshu", text: "Learn More Gain More..!!" },
  { id: "q2", author: "Mukko", text: "It's Good to be Selfish..!!" },
];

const AllQuote = () => {
  return (
    <Fragment>
      <QuoteList quote={Dummy_Quotes} />
    </Fragment>
  );
};

export default AllQuote;
